import React from "react";

const MissionList = (props) => {
  console.log(props.missionList);
  return (
    <div className="py-5 px-4">
      <ul className="-my-5 divide-y divide-gray-200">
        {props.missionList.map((mission) => (
          <li key={mission[0].id} className="py-5">
            {console.log(mission[0])}
            <div className="grid auto-cols-auto content-center space-x-4">
              <div>
                Type : {mission[0].missionType.name}
                Qty : {mission[0].quantity}
                VINs : {mission[0].vins}
                Pick-up address : {mission[0].pickUp}
                Drop-off address : {mission[0].dropOff}
                Fleet : {mission[0].fleet}
                Comment : {mission[0].comment}
              </div>
              <div>
                  <a
                    href="#"
                    className="inline-flex items-center shadow-sm px-2.5 py-0.5 border border-red-300 text-sm leading-5 font-medium rounded-full text-red-700 bg-white hover:bg-red-50"
                  >
                    Delete
                  </a>
                </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};
export default MissionList;
